import React, { useEffect } from 'react';
import '../home/home.css';
import imagenFondo from '../../img/fondohome3.jpg';
import { useSelector, useDispatch} from 'react-redux';





export default function Home() {

const dogtemperament = useSelector((state) => state.temperaments);
const dispatch = useDispatch();


useEffect(() => {

  dispatch(getAllTemperaments())
  dispatch(getAllRace())
}, [dispatch])



return (
    <div className="text"> 
      <h1 className="title">Universe of Dogs</h1>
      <img src={imagenFondo} alt="unirverse of Dog" className='imagefondo' />  
      <button onClick={getAllRace} className="btn-search">buscar Perros</button>
    </div>
  );
}
